  [],\n\t\"revision_timestamp\": \"2015-05-07T01:09:25.150462\",\n\t\"name\": \"fine-water-mist-fire-extinguisher-for-spacecraft-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This three phase SBIR project from ADA Technologies
  Inc. (ADA) builds upon the experience of ADA in development of fine water mist (FWM)
  fire suppression technology.  ADA has subcontracted Colorado School of Mines (CSM)
  to provide expertise in fire scenarios in NASA's spacecraft; Spraying Systems for
  their expertise nozzle development, optimization, testing, and commercial manufacturing;
  and Pacific Scientific HTL Kin-Tech Division as a commercialization partner with
  expertise in flight qualified hardware.  This team will work to develop the FWM
  fire extinguisher which was proven to extinguish fires in phase I.rnFWM is a proven
  fire suppression technology with the ability to extinguish large fuel fed fires,
  as well as, small electrical fires. Unlike sprinkler water systems it does not damage
  structures, and unlike CO2 or Halon fire extinguishers it has only inert chemicals
  water and nitrogen, so it is not a health hazard, environmental hazard and easily
  scrubbed from the air with dehumidifiers when used in spacecraft. This new extinguisher's
  innovative design has the capability to discharge in any orientation, and has been
  dubbed the Universal Discharge Orientation System (UDOS). During Phase I the UDOS
  system was capable of extinguishing fires in both normal vertical positions as well
  as upside down.  During the Phase II efforts the system will be evaluated to extinguish
  fires in any 360 degree orientation. The ultimate objective of this project is to
  develop a FWM fire extinguisher which can be commercially manufactured and is capable
  of extinguishing both large open fires and enclosed electrical fires with minimal
  water usage.rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
